import css from '../../css/style.scss'
import pic from '../../images/external_pic/pa-bulgogi.jpg';

function List(){
    return(
        <div className='list-wrap'>
            <ul>
                <li>
                    <img src={pic} alt="#" />
                    <div className="info">
                        <p>가게이름</p>
                        <p>전문점</p>
                        <p>가격</p>
                    </div>
                </li>
            </ul>
        </div>
    )
}

export default List;
